import React from "react";

function HelloDiv() {
  return <div>
    <h1>My name is Jessica</h1>
    <p>My favorite things:</p>
    <ul>Coffee</ul>
    <ul>Target</ul>
    <ul>Amazon</ul>
    </div>;
}

export default HelloDiv;
